import React from 'react';
import Button from 'react-bootstrap/Button';

const HeaderSection = ({ title = "НАШИТЕ ОСЛУГИ", description = "Ние предлагаме най-качествените ослуги на пазара!" }) => {
  return (
    <div className="d-flex flex-column align-items-start gap-3" style={{ minWidth: '300px', padding: '20px' }}>
      <h2 
        className="m-0"
        style={{
          color: '#333333',
          fontFamily: 'Poppins, sans-serif',
          fontSize: '32px',
          fontWeight: 500,
          lineHeight: '130%'
        }}
      >
        {description}
      </h2>
      <Button 
        variant="primary"
        style={{ 
          backgroundColor: '#1572d3',
          borderColor: '#1572d3',
          fontFamily: 'Poppins, sans-serif',
          fontSize: '14px',
          fontWeight: 700,
          lineHeight: '150%',
          padding: '10px 20px'
        }}
      >
        {title}
      </Button>
    </div>
  );
};

export default HeaderSection;
